import './assets/css/Reset.css';
import './App.css';
import { Header } from './Components/Header/Header';
import {BrowserRouter as Router, Route} from "react-router-dom";
import { Main } from './Components/Page/MainBlock/Main';

function App() {
  return (

      <div className="wrapper">
        <Header />
        <div className="page">
          <Main />
        </div>
      </div>

  );
}

export default App;
